interface IUTOP is IERC20 {
    function index() external view returns ( uint );
}

contract wsUTOP is ERC20 {
    using SafeERC20 for IUTOP;
    using LowGasSafeMath for uint;

    IUTOP public immutable UTOP;
    event Wrap(address indexed recipient, uint256 amountUTOP, uint256 amountWsUTOP);
    event UnWrap(address indexed recipient,uint256 amountWsUTOP, uint256 amountUTOP);

    constructor( address _UTOP ) ERC20( 'Wrapped Staked Utopia', 'wsUTOP' ) {
        require( _UTOP != address(0) );
        UTOP = IUTOP(_UTOP);
    }

    /**
        @notice wrap UTOP
        @param _amount uint
        @return uint
     */
    function wrap( uint _amount ) external returns ( uint ) {
        UTOP.safeTransferFrom( msg.sender, address(this), _amount );

        uint value = sUTOPTowsUTOP( _amount );
        _mint( msg.sender, value );
        emit Wrap(msg.sender, _amount, value);
        return value;
    }

    /**
        @notice unwrap UTOP
        @param _amount uint
        @return uint
     */
    function unwrap( uint _amount ) external returns ( uint ) {
        _burn( msg.sender, _amount );

        uint value = wsUTOPTosUTOP( _amount );
        UTOP.safeTransfer( msg.sender, value );
        emit UnWrap(msg.sender, _amount, value);
        return value;
    }

    /**
        @notice converts wUTOP amount to UTOP
        @param _amount uint
        @return uint
     */
    function wsUTOPTosUTOP( uint _amount ) public view returns ( uint ) {
        return _amount.mul( UTOP.index() ).div( 10 ** decimals );
    }

    /**
        @notice converts UTOP amount to wUTOP
        @param _amount uint
        @return uint
     */
    function sUTOPTowsUTOP( uint _amount ) public view returns ( uint ) {
        return _amount.mul( 10 ** decimals ).div( UTOP.index() );
    }

}

